pragma solidity >=0.4.21 <0.7.0;

import "./Migrations.sol";
pragma experimental ABIEncoderV2;

contract Workforce {
    enum ExpDurationMonth {Zero, January, February, March, April, May, June, July, August, September, October, November, December}
    enum SkillLevel {Default, Beginner, Intermediate, Advanced}
    enum ProficiencyLevel {Default, Novice, Fluent, Intermediate, Advanced, Superior} // Customized ACTFL Proficiency (American Council on the Teaching of Foreign Language)

    struct Employee {
        // Personal Information
        string name;
            uint nameChanges;
        string physicalAddress;
        string nationality;
        bool exists;

        // Experiences
        string[] experienceIdentifiers;

        // SKills
        string[] skillIdentifiers;

        // Salary Preference
        Stipend salaryFlooring;
        Stipend salaryCeiling;
    }

    struct Language {
        string name;
        ProficiencyLevel spokenProficiency;
        ProficiencyLevel writtenProficiency;
        bool exists;
    }

    struct Skill {
        string name;
        SkillLevel level;
        bool exists;
    }

    struct Experience {
        string positionTitle;
        string companyName;
        ExpDurationStart start;
        ExpDurationEnd end;
        string specialization;
        string role;
        string country;
        string industry;
        string positionLevel;
        Stipend monthlySalary;
        string description;
        bool exists;
    }

    struct ExpDurationEnd {
        uint year;
        Workforce.ExpDurationMonth ExpDurationMonth;
        bool present;
    }

    struct ExpDurationStart {
        uint year;
        Workforce.ExpDurationMonth ExpDurationMonth;
    }

    struct Stipend {
        string currency;
        uint amount;
    }

    mapping (address => Employee) employees;
    address[] employeeAccts;
    mapping (string => Experience) experiences;
    mapping (string => Skill) skills;


    event WorkforceAppend (address indexed _address);

    function setEmployee (address _address, string memory _name, string memory _physicalAddress, string memory _nationality, string memory _administrativeCode) public returns (bool) {
        if (!employees[_address].exists && compareStrings(_administrativeCode,"sudo")) {
            Employee storage employee = employees[_address];
            employee.name = _name;
            employee.nameChanges = 0;
            if (compareStrings(_physicalAddress,"")) {
                employees[_address].physicalAddress = "---";
            } else {
                employees[_address].physicalAddress = _physicalAddress;
            }
            if (compareStrings(_physicalAddress,"")) {
                employees[_address].nationality = "---";
            } else {
                employees[_address].nationality = _nationality;
            }
            employees[_address].salaryFlooring = createStipend("Php", 0);
            employees[_address].salaryCeiling = createStipend("Php", 0);
            employee.exists = true;
            employeeAccts.push(_address);
            emit Workforce.WorkforceAppend(_address);
            return true;
        } else {
            return false;
        }
    }

    function getEmployees(string memory _administrativeCode) view public returns(address[] memory) {
        if (compareStrings(_administrativeCode,"sudo")) {
            return employeeAccts;
        }
    }

    function getEmployeeProfile(address _address, string memory _administrativeCode) view public returns(Employee memory) {
        if ((compareStrings(_administrativeCode,"sudo") && msg.sender != _address) || (msg.sender == _address)) {
            return employees[_address];
        }
    }

    function updateName (address _address, string memory _name) public returns (bool, uint, string memory) {
        if (employees[_address].exists && msg.sender == _address) {
            if (employees[_address].nameChanges < 3) {
                employees[_address].name = _name;
                employees[_address].nameChanges+=1;
                return (true, 3-employees[_address].nameChanges, "Name changed!" );
            } else {
                return (false, employees[_address].nameChanges, "This account exceeds in the number of name changes.");
            }
        } else {
            return (false, 0, "Account holder does not exists or you are not the holder of this account.");
        }
    }

    function updateAddress(address _address, string memory _physicalAddress) public returns (bool, string memory) {
        if (employees[_address].exists && msg.sender == _address) {
            employees[_address].physicalAddress = _physicalAddress;
            return (true, "");
        } else {
            return (false, "Account holder does not exists or you are not the holder of this account.");
        }
    }

    function updateNationality(address _address, string memory _nationality) public returns (bool, string memory) {
        if (employees[_address].exists && msg.sender == _address) {
            employees[_address].nationality = _nationality;
            return (true, "");
        } else {
            return (false, "Account holder does not exists or you are not the holder of this account.");
        }
    }

    // Salary Preference Functions

    function setSalaryFlooring(address _address, string memory _currency, uint _amount) public returns (bool, string memory){
        if (msg.sender == _address) {
            if (compareStrings(_currency,"")) {
                employees[_address].salaryFlooring = createStipend("---", _amount);
                return (true, "");
            } else {
                employees[_address].salaryFlooring = createStipend(_currency, _amount);
                return (true, "");
            }
        } else {
            return (false, "Account holder does not exists or you are not the holder of this account.");
        }
    }

    function setSalaryCeiling(address _address, string memory _currency, uint _amount) public returns (bool, string memory){
        if (msg.sender == _address) {
            if (compareStrings(_currency,"")) {
                employees[_address].salaryCeiling = createStipend("---", _amount);
                return (true, "");
            } else {
                employees[_address].salaryCeiling = createStipend(_currency, _amount);
                return (true, "");
            }
            return (false, "Changing salary ceiling failed for a reason");
        } else {
            return (false, "Account holder does not exists or you are not the holder of this account.");
        }
    }

    // Skill Functions

    function getSkillDetails(address _address, string memory _skillName, string memory _administrativeCode) view public returns (Skill memory) {
        if ((compareStrings(_administrativeCode,"sudo") && msg.sender != _address) || (msg.sender == _address)) {
            bool _skillExists;
            uint _skillIndex;
            (_skillExists, _skillIndex) = skillFound(_address, _skillName, _administrativeCode);
            if (skills[_skillName].exists == true && _skillExists) {
                return skills[_skillName];
            }
        }
    }

    function updateSkill(
        address _address, string memory _skillName,
        uint _level
    ) public returns (bool, string memory) {
        string memory tempSkillIdentifier = string(abi.encodePacked(addressToString(_address), "-", _skillName));
        if (msg.sender == _address) {
            Skill storage skill = skills[tempSkillIdentifier];
            skill.name = _skillName;
            skill.level = selectSkillLevel(_level);
            skill.exists = true;
            bool _skillFound;
            uint _skillIndex;
            (_skillFound, _skillIndex) = skillFound(_address, tempSkillIdentifier, "");
            if (_skillFound == false && skills[tempSkillIdentifier].exists) {
                employees[_address].skillIdentifiers.push(tempSkillIdentifier);
            }
            return (true, "");
        } else {
            return (false, "Account holder does not exists or you are not the holder of this account.");
        }
    }

    function skillFound(address _address, string memory _skillName, string memory _administrativeCode) public view returns (bool, uint) {
        if ((msg.sender == _address) || (compareStrings(_administrativeCode, "sudo"))) {
            bool found = false;
            uint index = 0;
            for (uint i = 0; i < employees[_address].skillIdentifiers.length; i++) {
                if (compareStrings(employees[_address].skillIdentifiers[i], _skillName)) {
                    found = true;
                    index = i;
                }
            }
            if (found) {
                return (true, index);
            } else {
                return (false, 0);
            }
        } else {
            return (false, 0);
        }
    }

    function deleteSkill(address _address, string memory _skillName) public returns (bool, string memory) {
        if (_address == msg.sender) {
            bool _skillFound;
            uint _skillIndex;
            (_skillFound, _skillIndex) = skillFound(_address, _skillName, "");
            if (_skillFound == true && skills[_skillName].exists) {
                skills[_skillName].exists = false;
                for (uint i = _skillIndex; i<employees[_address].skillIdentifiers.length-1; i++){
                    employees[_address].skillIdentifiers[i] = employees[_address].skillIdentifiers[i+1];
                }
                delete employees[_address].skillIdentifiers[employees[_address].skillIdentifiers.length-1];
                employees[_address].skillIdentifiers.length-=1;
                return (true, "");
            }
            return (true, "");
        } else {
            return (false, "One must be able to change own skills by logging in with one's own address");
        }
    }

    // Experience Functions

    function getExperienceDetails(address _address, string memory _experienceName, string memory _administrativeCode) view public returns (Experience memory) {
        if ((compareStrings(_administrativeCode,"sudo") && msg.sender != _address) || (msg.sender == _address)) {
            bool _experienceExists;
            uint _experienceIndex;
            (_experienceExists, _experienceIndex) = experienceFound(_address, _experienceName, _administrativeCode);
            if (experiences[_experienceName].exists == true && _experienceExists) {
                return experiences[_experienceName];
            }
        }
    }

    function updateExperience(
        address _address, string memory _experienceName,
        string[] memory _details, uint[] memory _start, uint[] memory _end, bool _present,
        string memory _currency, uint _amount
    ) public returns (bool, string memory) {
        string memory tempExperienceIdentifier = string(abi.encodePacked(addressToString(_address), "-", _experienceName));
        if (msg.sender == _address) {
            Experience storage experience = experiences[tempExperienceIdentifier];
            experience.positionTitle = _details[0];
            experience.companyName = _details[1];
            experience.specialization = _details[2];
            experience.role = _details[3];
            experience.country = _details[4];
            experience.industry = _details[5];
            experience.positionLevel = _details[6];
            experience.description = _details[7];
            experience.start = createExpDurationStart(_start[0], _start[1]);
            experience.end = createExpDurationEnd(_end[0], _end[1], _present);
            experience.monthlySalary = createStipend(_currency, _amount);
            experience.exists = true;
            bool _experienceFound;
            uint _experienceIndex;
            (_experienceFound, _experienceIndex) = experienceFound(_address, tempExperienceIdentifier, "");
            if (_experienceFound == false && experiences[tempExperienceIdentifier].exists) {
                employees[_address].experienceIdentifiers.push(tempExperienceIdentifier);
            }
            return (true, "");
        } else {
            return (false, "Account holder does not exists or you are not the holder of this account.");
        }
    }

    function experienceFound(address _address, string memory _experienceName, string memory _administrativeCode) public view returns (bool, uint) {
        if ((msg.sender == _address) || (compareStrings(_administrativeCode, "sudo"))) {
            bool found = false;
            uint index = 0;
            for (uint i = 0; i < employees[_address].experienceIdentifiers.length; i++) {
                if (compareStrings(employees[_address].experienceIdentifiers[i], _experienceName)) {
                    found = true;
                    index = i;
                }
            }
            if (found) {
                return (true, index);
            } else {
                return (false, 0);
            }
        } else {
            return (false, 0);
        }
    }

    function deleteExperience(address _address, string memory _experienceName) public returns (bool, string memory) {
        if (_address == msg.sender) {
            bool _experienceFound;
            uint _experienceIndex;
            (_experienceFound, _experienceIndex) = experienceFound(_address, _experienceName, "");
            if (_experienceFound == true && experiences[_experienceName].exists) {
                experiences[_experienceName].exists = false;
                for (uint i = _experienceIndex; i<employees[_address].experienceIdentifiers.length-1; i++){
                    employees[_address].experienceIdentifiers[i] = employees[_address].experienceIdentifiers[i+1];
                }
                delete employees[_address].experienceIdentifiers[employees[_address].experienceIdentifiers.length-1];
                employees[_address].experienceIdentifiers.length-=1;
                return (true, "");
            }
            return (true, "");
        } else {
            return (false, "One must be able to change own experiences by logging in with one's own address");
        }
    }


    // Auxiliary Functions
    function compareStrings (string memory a, string memory b) public pure returns (bool) {
        return (keccak256(abi.encodePacked((a))) == keccak256(abi.encodePacked((b))));
    }

    function addressToString (address x) public pure returns (string memory) {
        bytes32 value = bytes32(uint256(x));
        bytes memory alphabet = "0123456789abcdef";

        bytes memory str = new bytes(42);
        str[0] = '0';
        str[1] = 'x';
        for (uint i = 0; i < 20; i++) {
            str[2+i*2] = alphabet[uint(uint8(value[i + 12] >> 4))];
            str[3+i*2] = alphabet[uint(uint8(value[i + 12] & 0x0f))];
        }
        return string(str);
    }

    function selectExpDurationMonth (uint _monthIndex) internal pure returns (Workforce.ExpDurationMonth) {
        if (_monthIndex == 1) return Workforce.ExpDurationMonth.January;
        if (_monthIndex == 2) return Workforce.ExpDurationMonth.February;
        if (_monthIndex == 3) return Workforce.ExpDurationMonth.March;
        if (_monthIndex == 4) return Workforce.ExpDurationMonth.April;
        if (_monthIndex == 5) return Workforce.ExpDurationMonth.May;
        if (_monthIndex == 6) return Workforce.ExpDurationMonth.June;
        if (_monthIndex == 7) return Workforce.ExpDurationMonth.July;
        if (_monthIndex == 8) return Workforce.ExpDurationMonth.August;
        if (_monthIndex == 9) return Workforce.ExpDurationMonth.September;
        if (_monthIndex == 10) return Workforce.ExpDurationMonth.October;
        if (_monthIndex == 11) return Workforce.ExpDurationMonth.November;
        if (_monthIndex == 12) return Workforce.ExpDurationMonth.December;
        return Workforce.ExpDurationMonth.Zero;
    }

    function selectSkillLevel (uint _levelIndex) internal pure returns (Workforce.SkillLevel) {
        if (_levelIndex == 1) return Workforce.SkillLevel.Beginner;
        if (_levelIndex == 2) return Workforce.SkillLevel.Intermediate;
        if (_levelIndex == 3) return Workforce.SkillLevel.Advanced;
        return Workforce.SkillLevel.Default;
    }

    function createExpDurationStart (uint _year, uint _month) internal pure returns (Workforce.ExpDurationStart memory) {
        return Workforce.ExpDurationStart(uint(_year), selectExpDurationMonth(_month));
    }

    function createExpDurationEnd (uint _year, uint _month, bool _present) internal pure returns (Workforce.ExpDurationEnd memory) {
        return Workforce.ExpDurationEnd(uint(_year), selectExpDurationMonth(_month), _present);
    }

    function createStipend (string memory _currency, uint _amount) internal pure returns (Workforce.Stipend memory){
        return Workforce.Stipend(_currency, _amount);
    }
}
